<div><h1>《霍乱时期的爱情》</h1><h1><br></h1></div>
<div>他心里明白，自己并不爱她。同她结婚是因为喜欢她的高傲，她的严肃，她的力量，也因为自己的一点儿虚荣心，但当她第一次吻他时，他确定，没有什么障碍能阻止他们建立一份完美的爱情。在那一个晚上，他们什么都聊了，一直聊到天亮，就是没有谈到爱情，以后也永远不会谈到它。但从最后的结果来看，两个人谁都没有做错。<br></div>
